import React from "react";
import './ServicesSection.css';

function ServicesSection() {
  return (
    <section className="services-section">
      <h2>Buat Permohonan Disini</h2>
      <div className="services-container">
        {/* Service Card 1 */}
        <div className="service-card">
          <img src="banner.jpg" alt="Service 1 Banner" />
          <h3>Service 1</h3>
          <p>Description of Service 1.Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1Description of Service 1</p>
          <a href="#service1">Learn More</a>
        </div>

        {/* Service Card 2 */}
        <div className="service-card">
          <img src="banner.jpg" alt="Service 2 Banner" />
          <h3>Service 2</h3>
          <p>Description of Service 2.</p>
          <a href="#service2">Learn More</a>
        </div>

        {/* Service Card 3 */}
        <div className="service-card">
          <img src="banner.jpg" alt="Service 3 Banner" />
          <h3>Service 3</h3>
          <p>Description of Service 3.</p>
          <a href="#service3">Learn More</a>
        </div>
      </div>
    </section>
  );
}

export default ServicesSection;
